import logo from './img/logo.png';
import textlogo from './img/text.png';
import folder2 from './img/folder2.png';
import './App.css';
import React, {useState, useEffect, useRef} from 'react';
import { cleanup } from '@testing-library/react';


function App() {

  const [date, setDate] = useState(new Date());

  const aboutRef = useRef(null);
  const containerRef = useRef(null);
  const aboutIsClicked = useRef(false);
  const aboutCoords = useRef({startX: 100, startY: 100, lastX: 100, lastY: 100});
  let aboutX = 100;
  let aboutY = 100;

  const refs =[{ref: aboutRef, isClicked: aboutIsClicked, coords: aboutCoords, x: aboutX, y: aboutY}]

  useEffect(() => {
    const interval = setInterval(() => setDate(new Date()), 6000);

    for (let r of refs) {
      let [ref, isClicked, coords, x, y] = [r.ref, r.isClicked, r.coords, r.x, r.y];
      if (ref.current && containerRef.current) {
        const about = aboutRef.current;
        const container = containerRef.current;

        const onMouseDown = (e) => {
          aboutIsClicked.current = true;
          aboutCoords.current.startX = e.clientX;
          aboutCoords.current.startY = e.clientY;
          aboutY = e.clientY;
          aboutX = e.clientX;
        }

        const onMouseUp = (e) => {
          aboutIsClicked.current = false;
          aboutCoords.current.lastX = about.offsetLeft;
          aboutCoords.current.lastY = about.offsetTop;
          if (e.clientX == aboutX && e.clientY == aboutY) {
            console.log("yes");
          }
        }

        const onMouseMove = (e) => {
          if (!aboutIsClicked.current) {
            return ;
          }
          const nextX = e.clientX - aboutCoords.current.startX + aboutCoords.current.lastX;
          const nextY = e.clientY - aboutCoords.current.startY + aboutCoords.current.lastY;
          about.style.top = `${nextY}px`;
          about.style.left = `${nextX}px`;
        }

        about.addEventListener('mousedown', onMouseDown)
        about.addEventListener('mouseup', onMouseUp)
        container.addEventListener('mousemove', onMouseMove)
        container.addEventListener('mouseleave', onMouseUp)

        const cleanUp = () => {
          about.removeEventListener('mousedown', onMouseDown);
          about.removeEventListener('mouseup', onMouseUp);
          container.removeEventListener('mousemove', onMouseMove)
          container.removeEventListener('mouseleave', onMouseUp)
        }
        return cleanUp;
      }
    }

    return () => clearInterval(interval);
  }, []);


    return (
      <div className="parent">
        <div className="entry">
          <div className="bar">
            <div className="logodiv">
              <img className="logo" src={logo}/>
              <div className="link">Email</div>
              <div className="link">LinkedIn</div>
              <div className="link">Github</div>
            </div>
            <div>
              <span className="date">{date.getMonth()+1}/{date.getDate()}/{date.getYear()+1900}</span>
              <span className="time">
              {date.getHours() > 12 ? date.getHours() - 12 : date.getHours()}:{String(date.getMinutes()).length < 2 ? `0${String(date.getMinutes())}` : String(date.getMinutes())} {date.getHours() > 12 ? "PM" : "AM"}
              </span>
            </div>
          </div>
          <div className="main">
            <div className="container" ref={containerRef}>
            <div className="about" ref={aboutRef}>
              <div className="text-div">
                <img className="text" src={textlogo}/>
              </div>
              <div className="name">ABOUTME.txt</div>
            </div>
            <div className="projects">
              <div className="text-div">
                <img className="folder" src={folder2}/>
              </div>
              <div className="name">projects</div>
            </div>
            <div className="experience">
              <div className="text-div">
                <img className="folder" src={folder2}/>
              </div>
              <div className="name">experience</div>
            </div>


            </div>
          </div>
        </div>
      </div>
    );
}

export default App;
